import React,{useEffect} from 'react';

const App = () => {

let instaFeedURL = [];

    useEffect(()=> {
         // fetch(`https://cors-anywhere.herokuapp.com/https://www.googleapis.com/blogger/v3/blogs/9085604028025620950/posts?key=AIzaSyChWrKyLjsVyYj42CKBstkjrOnKWwPLqDs`)
        // .then(resp => resp.json())
        // .then(data => console.log(data.items));




        fetch(`https://graph.instagram.com/me?fields=media&access_token=IGQVJXaDdsWnQ1am42V1ByeENZAcDRnS29OdF9ncUkzZAWtFYUtoTjFJM0w3N093X0hJV004RjZAkMEQyZAndPNEM0SVRxTTBQR1o2dE9rRG5uZAG51eVozdmsxRTVLLThLQ2pmclkzcUZATaVhPcURyN0RENAZDZD`)
           .then(resp => resp.json())
           .then(data => data.media.data.forEach(imageID => fetch(`https://graph.instagram.com/${imageID.id}?fields=media_url&access_token=IGQVJXaDdsWnQ1am42V1ByeENZAcDRnS29OdF9ncUkzZAWtFYUtoTjFJM0w3N093X0hJV004RjZAkMEQyZAndPNEM0SVRxTTBQR1o2dE9rRG5uZAG51eVozdmsxRTVLLThLQ2pmclkzcUZATaVhPcURyN0RENAZDZD`).then(res => res.json()).then(url => instaFeedURL.push(url.media_url))));

       console.log(instaFeedURL);
})

    return (
        <div> 
              {
                  instaFeedURL.map(url => <img alt='' src={url}></img>)
              }
        </div>
    )
}

export default App;
